nto interessante a respeito desse exemplo é que ele passa 
null para Object.create() a fim de 
criar um objeto que não herda nada. Esse objeto é usado para armazenar os membros do conjunto 
e o fato de não ter protótipo nos permite utilizar o operador in com ele, em vez do método hasOwn-
Property().
Exemplo 9-22 StringSet: uma subclasse de Set usando ECMAScript 5
function StringSet() {
    this.set = Object.create(null); // Cria um objeto sem protótipo
    this.n = 0;
    this.add.apply(this,    arguments);
}
// Note que com Object.create podemos herdar do protótipo da superclasse
